import React from 'react';
import {FadeIn} from 'react-slide-fade-in';
import "../styles/news.css";

const NewsItem = () => {
  return (
    <div class="news-item-box">
    </div>
  )
};

const News = () => {
  return (
    <div id="news-div">
      <FadeIn
      durationInMilliseconds={500}
      >
        <h1>News</h1>
      </FadeIn>
    </div>
  )
};

export default News;
